import 'bootstrap/dist/css/bootstrap.min.css';
import React from "react";



const SidebarElements = ({ width, height, children }) => {

  return (
    <div>
      <div className="side-bar">
        <div className="content">{children}</div>
      </div>
    </div>
  );
};

export default SidebarElements;
